@pq For Android Studio you need `<filename>.<line number>` (`MainActivity.java:16`).

For Flutter you get the best result with the `location` from a stack trace frame, it looks like `package:consumer/src/ui/cart/cart_page_bloc.dart 7:41` and when you click on it, it jumps to the line and column. The file name alone doesn't work.

But you need to find a way to extract these pieces of information from the stack trace. Currently, I use the first frame whose `package` name matches with the name of the project module. It works in most cases.
